import { Component } from "react";

class Pavani extends Component{
    constructor(props){
        super(props)
        this.state={
            id:1,
            book:"javascript",
            author:"pavani"
        }
    }
    render(){
        render(
            <div>
                id:{this.state.id}<br/>
                book:{this.state.name}<br/>
                author:{this.state.author}

            </div>
        )
    }
}
export  default Pavani;
